object.script:
gb = input.getBool gn = input.getNumber sb = output.setBool sn = output.setNumber pgb = property.getBool pgn = property.getNumber sc=screen.setColor dl=screen.drawLine dc=screen.drawCircle ON = false L = false DV = 0 DH = 0 PV = 0 PH = 0 BLINK = false P = 0 RG = 1000 BR = false BL = false BI = false D = 0 _R = pgn('Display R') _G = pgn('Display G') _B = pgn('Display B') _SDS = pgb('Small Display Scan') DS = {0,0,0,0,0} -- Distances PS = {0,0,0,0,0} -- Powers YS = {0,0,0,0,0} -- Yaws
function onTick() ON = gb(32) L = gb(4) DV = gn(5) DH = gn(6) PV = gn(7) PH = gn(8) P = gn(30) D = gn(27) RG = gn(29) BLINK = gb(31) BR = gb(1) BL = gb(2) BI = gb(3)
for i = 1, 5 do DS[i] = gn(10+i) PS[i] = gn(15+i) YS[i] = gn(20+i) end end
-- Draw function that will be executed when this script renders to a screen function onDraw() w = screen.getWidth() h = screen.getHeight()
if ON then if L then screen.setColor(_R*0.5,_G*0.5,_B*0.5,255) screen.drawTriangle(-1,-1,w/2,h,w+1,-1) screen.setColor(_R*0.5,_G*0.5,_B*0.5,15) screen.drawTriangleF(-1,-1,w/2,h,w+1,-1)
if D > 0 then x = w*(0.5-PV*4) y = h-h*D/RG -- avg distance screen.setColor(_R*0.33,_G*0.33,_B*0.33,255) screen.drawLine(w/2,h,x,y)
screen.setColor(_R,_G,_B,255) if (DV > 1 and DH > 1) or BLINK then if pgb('Lock Shape') then screen.drawRect(x-3,y-3,6,6) else screen.drawCircle(x,y,3) end end end else if _SDS then -- draw circular scan for i = 1, 5 do if DS[i] > 1 and RG > 0 then screen.setColor(_R,_G,_B,clamp(255*PS[i],0,255)) x,y = rotate(0,-(DS[i]/RG)*(w/2),-YS[i]) screen.drawCircleF(w/2-x,h/2+y,2) end end
screen.setColor(_R*0.5,_G*0.5,_B*0.5,255) x,y = rotate(0,-0.5 * math.max(w,h),P) screen.drawLine(w/2,h/2,(w/2)+x,(h/2)+y) else -- draw flat scan screen.setColor(_R,_G,_B,255) x = w*(0.5+P) screen.drawLine(x,0,x,h)
for i = 1, 5 do if DS[i] > 1 and RG > 0 then screen.setColor(_R,_G,_B,clamp(255*PS[i],0,255)) x,y = w*(0.5+YS[i]),h-h*DS[i]/RG screen.drawCircleF(x,y,2) end end end end end -- buttons if BR then screen.setColor(_R*0.25,_G*0.25,_B*0.25,255) else screen.setColor(63,63,63,255) end screen.drawRectF(1, 24, 5, 7)
if BL then screen.setColor(_R*0.25,_G*0.25,_B*0.25,255) else screen.setColor(63,63,63,255) end screen.drawRectF(7, 24, 5, 7)
if BI then screen.setColor(_R*0.25,_G*0.25,_B*0.25,255) else screen.setColor(63,63,63,255) end screen.drawRectF(13, 24, 17, 7)
screen.setColor(191,191,191,255) dst(2, 25,'R') dst(8, 25,'T') if ON then dst(14,25,'SCAN') else dst(14,25,'IDLE') end r = RG m = 'm' if r >= 1000 then r = r / 1000 m = 'km' end screen.drawText(1, 1,'R:' .. string.format('%d', r//1) .. m) end
function clamp(x,min,max) if x < min then return min elseif x > max then return max else return x end end
--draw small text (x, y, text) function dst(x,y,t) l=string.len(t) for i=1,l do s=t:sub(i,i) if s=="A" then dc(x+1,y+1,1) dl(x,y+1,x,y+5) dl(x+2,y+1,x+2,y+5) elseif s=="C" then dl(x+1,y,x+3,y) dl(x+1,y+4,x+3,y+4) dl(x,y+1,x,y+4) elseif s=="D" then dl(x,y,x+2,y) dl(x,y+4,x+2,y+4) dl(x,y,x,y+5) dl(x+2,y+1,x+2,y+4) elseif s=="E" then dl(x,y,x+3,y) dl(x,y+2,x+2,y+2) dl(x,y+4,x+3,y+4) dl(x,y,x,y+5) elseif s=="I" then dl(x,y,x+3,y) dl(x,y+4,x+3,y+4) dl(x+1,y,x+1,y+5) elseif s=="L" then dl(x,y+4,x+3,y+4) dl(x,y,x,y+5) elseif s=="N" then dl(x,y,x+3,y) dl(x,y,x,y+5) dl(x+2,y,x+2,y+5) elseif s=="R" then dc(x+1,y+1,1) dl(x,y,x,y+5) dl(x+2,y+3,x+2,y+5) elseif s=="S" then dl(x+1,y,x+3,y) dl(x,y+4,x+2,y+4) dl(x,y+1,x+3,y+4) elseif s=="T" then dl(x,y,x+3,y) dl(x+1,y,x+1,y+5) end x=x+4 end end
function rotate(x,y,a) cos = math.cos(a*3.1415*2) sin = math.sin(a*3.1415*2) return (cos*x-sin*y), (sin*x + cos*y) end
